import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import UsersPage from './UsersPage'; // Assure-toi que le chemin est correct
import {
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer
} from 'recharts';

const data = [
  { name: 'Janvier', utilisateurs: 30 },
  { name: 'Février', utilisateurs: 45 },
  { name: 'Mars', utilisateurs: 60 },
  { name: 'Avril', utilisateurs: 50 },
  { name: 'Mai', utilisateurs: 70 },
];

export default function AdminDashboard() {
  const navigate = useNavigate();
  const [content, setContent] = useState('dashboard'); // dashboard ou users

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const renderContent = () => {
    if (content === 'dashboard') {
      return (
        <>
          <h1>Dashboard</h1>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="utilisateurs" fill="#8884d8" />
            </BarChart>
          </ResponsiveContainer>
          <p>Voici un aperçu des utilisateurs sur les derniers mois.</p>
        </>
      );
    } else if (content === 'users') {
      return <UsersPage />;
    } else {
      return <p>Contenu non disponible.</p>;
    }
  };

  return (
    <div style={{ display: 'flex', minHeight: '100vh' }}>
      <nav
        style={{
          width: 220,
          backgroundColor: '#3b3f6b',
          color: 'white',
          padding: 20,
          display: 'flex',
          flexDirection: 'column',
          gap: 15,
        }}
      >
        <h2 style={{ marginBottom: 30 }}>Admin Panel</h2>

        <button style={menuButton} onClick={() => setContent('dashboard')}>
          📊 Dashboard
        </button>
        <button style={menuButton} onClick={() => setContent('users')}>
          👥 Utilisateurs
        </button>
        <button style={menuButton} onClick={() => alert('Notifications')}>
          🔔 Notifications
        </button>
        <button style={menuButton} onClick={() => alert('Messages')}>
          ✉️ Messages
        </button>
        <button style={menuButton} onClick={() => alert('Reports')}>
          ✉️ Reports
        </button>

        <div style={{ marginTop: 'auto' }}>
          <button
            style={{ ...menuButton, backgroundColor: '#d9534f' }}
            onClick={handleLogout}
            onMouseOver={e => (e.currentTarget.style.backgroundColor = '#c9302c')}
            onMouseOut={e => (e.currentTarget.style.backgroundColor = '#d9534f')}
          >
            🚪 Déconnexion
          </button>
        </div>
      </nav>

      <main style={{ flex: 1, padding: 30, overflowY: 'auto' }}>
        {renderContent()}
      </main>
    </div>
  );
}

const menuButton = {
  backgroundColor: 'transparent',
  border: 'none',
  color: 'white',
  textAlign: 'left',
  padding: '10px 15px',
  fontSize: 18,
  cursor: 'pointer',
  borderRadius: 6,
  fontWeight: 'bold',
  transition: 'background-color 0.3s',
};
